import 'mdb-react-ui-kit/dist/css/mdb.min.css'

function Main(props) {
	return (
		<>
			<iframe width="560" height="315" src="https://www.youtube.com/embed/psVZw5IVBjQ" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
		</>
	);
};

export default Main;
